import React from 'react'
import { Link } from 'react-router-dom'

const Header = () => {
  return (
    <header className='sticky top-0 w-full py-6 shadow-lg'>
      <div class="container max-w-[1200px] w-full mx-auto px-2 flex items-center justify-between">
        {/* Logo */}
        <a href="" className='text-3xl font-bold'>Logo</a>
        {/* Right header */}
        <div>
            {/* Search button */}
            <button><i class="fa-solid fa-magnifying-glass"></i></button>
            {/* Favorite button */}
            <button><i class="fa-regular fa-heart"></i></button>
            {/* Register login button */}
            <div>
              <Link>Register</Link>
            </div>
        </div>
      </div>
    </header>
  )
}

export default Header
